import axios from "axios";

const instance = axios.create({
	baseURL: 'https://localhost:4000/api',
 });

export const registration = async (username: string | number, password: string | number) => {
	 try {
 		 instance.post('/user/registration', {
			username,
			password
		  }).then(() => console.log('User sign up')
		  )
	 } catch (e) {
		 console.log(e);
	 }
 }
